import React from 'react';
import './UI/error.css'

const ProductsError = ({active, setActive}) => {
    return (
        <div>
            <div class="error" onClick={() => setActive(false)}>
                <div class="error__wrapper" onClick={e => e.stopPropagation()}>
                    <i class="ri-close-line error__close"></i>

                    <i class="ri-close-line error__icon"></i>
                    <h3 class="error__title">Ошибка!</h3>
                    <p class="error__subtitle">
                        Вы не авторизованы на нашем сайте! Перед покупкой сборки, необходимо зарегистрироваться. 
                    </p>
                    <Link to="/register" class="error__button">Зарегистрироваться</Link>
                </div>
            </div>
        </div>
    );
}

export default ProductsError;
